import { apis } from '../../Apis/apis'
import { useDispatch, useSelector } from 'react-redux'
import { getItems } from '../../Slices/ItemsSlice'
import Item from '../Item/Item'
import { getProductsData } from '../../helpers/getProductsData'
import { filterProductsData } from '../../helpers/filterProductsData'
import { productsType, stateType } from '../../types/Types'
import Cart from '../Cart/Cart'
import { useItem } from './items.hook'

const Items = () => {
  const data = useItem()
  
  return (
    <div>
      <Cart/>
      {
        data.map((item: productsType) => <Item key={item.id} item = {item}/>)
      }
    </div>
  )
}

export default Items
